import{_ as a,c as r,ai as t,o}from"./chunks/framework.BODoyW7Z.js";const _=JSON.parse('{"title":"2024的碎语","description":"","frontmatter":{"title":"2024的碎语","prev":false,"next":false,"comment":false,"publish":false},"headers":[],"relativePath":"blog/cross/2024/index.md","filePath":"blog/cross/2024/index.md"}'),e={name:"blog/cross/2024/index.md"};function n(s,p,l,i,h,g){return o(),r("div",null,p[0]||(p[0]=[t('<h1 id="_2024的碎语" tabindex="-1">2024的碎语 <a class="header-anchor" href="#_2024的碎语" aria-label="Permalink to &quot;2024的碎语&quot;">​</a></h1><h2 id="_12月" tabindex="-1">12月 <a class="header-anchor" href="#_12月" aria-label="Permalink to &quot;12月&quot;">​</a></h2><p><strong>2024-12-13 14:51:34</strong></p><p>不能细想，不然全是伤心。</p><p><strong>2024-12-11 01:25:45</strong></p><p>感觉其实Typecho的默认主题也完全够用。</p><p><strong>2024-12-06 02:21:01</strong></p><p>为一个没人看的个人网站，一年花费小一千，真的值得吗？</p><h2 id="_11月" tabindex="-1">11月 <a class="header-anchor" href="#_11月" aria-label="Permalink to &quot;11月&quot;">​</a></h2><p><strong>2024-11-29 20:25:30</strong></p><p>我偶尔会觉得自己是个天才。</p><p><strong>2024-11-26 13:38:09</strong></p><p>感觉钓鱼比打游戏好玩多了。。。</p><p><strong>2024-11-25 01:47:52</strong></p><p>现在亚刻给我的感觉就是鸡肋。</p><p><strong>2024-11-18 14:50:55</strong></p><p>加布真好看吧，起码目前为止是这样，这几年的骑士剧属实让我不敢半场开香槟。</p><p><strong>2024-11-17 08:54:46</strong></p><p>好想钓鱼啊啊啊啊啊啊啊啊啊</p><p>（坏了，染上钓鱼了</p><p><strong>2024-11-17 00:53:25</strong></p><p>合理怀疑我的网站访问慢是我的NGINX配置问题。</p><p><strong>2024-11-16 13:59:32</strong></p><p>试试Typecho的朋友圈主题</p><h2 id="_10月" tabindex="-1">10月 <a class="header-anchor" href="#_10月" aria-label="Permalink to &quot;10月&quot;">​</a></h2><p><strong>2024-10-12 22:20:59</strong></p><p>试试vercel。</p><p><strong>2024-10-11 19:29:54</strong></p><p>不管是对文艺作品也好，对游戏也好，对美食也好，我都会有一个较为主观的评价。</p><p>这个评价很大程度上依赖于我自己的喜好和口味。</p><p>我尚未达到那种，阅尽千帆后的，能对一个事物能做出足够客观的评价，的境界。</p><p>依据我现在的评价标准来看：在美食节目里大谈文化纯属耍流氓，我只想知道它口味如何，好不好吃。（图穷匕见）</p><p><strong>2024-10-07 06:16:19</strong></p><p>己所不欲，勿施于人。</p><p>己所欲者，勿强于人。</p><p><strong>2024-10-05 12:16:34</strong></p><p>摘抄：“感受不到的爱就不是爱。”</p><p>另一个摘抄：“</p><p>有人说：‘我这样破碎的人，爱我的人，要一片片捡起来爱我，实在是太辛苦了。’</p><p>有人回复：‘爱你的人会美滋滋地边捡边喃喃道：这片是我的，这片也是我的。’ ”</p><p><strong>2024-10-05 10:02:06</strong></p><p>我好像有个挺奇怪的习惯。</p><p>比如，我在看完各种刷到的小片段之后，对《葬送的芙莉莲》还挺感兴趣的。</p><p>按理来说我这时候应该去把这个番看一遍。但是因为我知道这个番很短，所以我又不愿意去看了。</p><p>我怕很快看完了，所以不去看。</p><p>类似于有些人会把喜欢的菜最后吃掉的心情吧。</p><p>但如果不去看，那这个番对我而言反而更像不存在一样。我觉得番对于一个个人的最直接的价值就是被看。</p><p>总之正常人都是：刷到、喜欢、追番，这个流程吧。</p><p>还挺奇妙的。</p><p><strong>2024-10-03 10:22:51</strong></p><p>累了，毁灭吧，赶紧的。</p><p>（其实只是对博客访问速度不满意，又找不到符合我需求和现况的解决方法。）</p><h2 id="_9月" tabindex="-1">9月 <a class="header-anchor" href="#_9月" aria-label="Permalink to &quot;9月&quot;">​</a></h2><p><strong>2024-09-23 22:44:00</strong></p><p>人们喜欢傲娇，喜欢的是娇而不是傲，喜欢呆萌，喜欢的是萌而不是呆。</p><h2 id="_8月" tabindex="-1">8月 <a class="header-anchor" href="#_8月" aria-label="Permalink to &quot;8月&quot;">​</a></h2><p><strong>2024-08-12 04:19:37</strong></p><p>总是躲到这又躲到那，躲来躲去，最后躲无可躲。</p><p><strong>2024-08-10 22:14:30</strong></p><p>有很多话想说，却不知从何说起。</p><h2 id="_7月" tabindex="-1">7月 <a class="header-anchor" href="#_7月" aria-label="Permalink to &quot;7月&quot;">​</a></h2><p><strong>2024-07-03 04:59:50</strong></p><p>睡不着去翻书看，我把书翻烂了也没看出李清照的《如梦令·昨夜雨疏风骤》是写男欢女爱和宅斗的。</p><h2 id="_5月" tabindex="-1">5月 <a class="header-anchor" href="#_5月" aria-label="Permalink to &quot;5月&quot;">​</a></h2><p><strong>2024-05-30 01:41:17</strong></p><p>道路是曲折的，前途是光明的。</p><p><strong>2024-05-30 00:00:19</strong></p><p>控制情绪。</p><p><strong>2024-05-06 02:40:05</strong></p><p>想会得多，那就得去学得多。</p><h2 id="_4月" tabindex="-1">4月 <a class="header-anchor" href="#_4月" aria-label="Permalink to &quot;4月&quot;">​</a></h2><p><strong>2024-04-11 02:29:08</strong></p><p>不要变得麻木。</p><h2 id="_3月" tabindex="-1">3月 <a class="header-anchor" href="#_3月" aria-label="Permalink to &quot;3月&quot;">​</a></h2><p><strong>2024-03-27 19:50:35</strong></p><p>把博客里所有关于计算机的文章整理成一个文档式的网站了，不得不说，好用多了。</p>',76)]))}const c=a(e,[["render",n]]);export{_ as __pageData,c as default};
